- input: "TEXT\x1CC00364380\x1C.TEXT\x1C\x1CF3N\x1CCandidate Roger F. Wicker was appointed
    United States Senator on December 31, 2007, at which time this campaign committee
    ceased active operation.  Expenses paid from that date forward relate to the expenses
    of closing the campaign office and activities.  On January 2, 2008, the bulk of
    campaign funds, all of which were carryover funds from prior campaigns, were transferred
    to the new Senate campaign committee, Wicker for Senate (C00443218).  After substantially
    all remaining expenses were paid, a second, smaller transfer was made on March
    31, 2008, leaving the balance shown on this report to use for any late bills.
    \ This balance will be transferred to the Wicker for Senate campaign committee
    within 60 days."
